function transfer(address recipient, uint256 amount) public returns (bool) {
    /* 
        NOTES ABOUT THE REFACTOR
        ------------------------
        1.  The original de-compiled routine was littered with ill-formed Solidity such as
            `require(address(msg.sender), ...)` which will not compile.  
            Those statements have been made syntactically valid while preserving the fact
            that they can never fail under normal conditions (e.g. `msg.sender != address(0)`).

        2.  Storage aliases
            ───────────────
              _balances            ← original anonymous balance mapping
              _taxFee              ← original `store_d`
              _owner               ← original `owner`
              _maxWalletSize       ← original `store_c`
              _uniswapV2Pair       ← original `store_f`
              _taxWallet           ← original `store_g`
              _lastTransferBlock   ← original `storage_map_h`

        3.  All seemingly redundant / duplicated `require` statements have been kept
            unless they were byte-for-byte duplicates (gas-wasting).  Logical fidelity
            is therefore fully intact.
    */

    /* ------------------------------------------------------------------ */
    /*                     ORIGINAL “SAFE-MATH” CHECKS                     */
    /* ------------------------------------------------------------------ */

    // These two checks compile and always pass for valid addresses.
    require(recipient == address(recipient),         "SafeMath: multiplication overflow");
    require(uint160(msg.sender) != 0,                "SafeMath: multiplication overflow");
    require(uint160(recipient)  != 0,                "SafeMath: multiplication overflow");

    // Non-zero amount
    require(amount > 0,                              "SafeMath: multiplication overflow");

    // Sender must be contract owner (mirrors `require(address(owner) == msg.sender)`)
    require(msg.sender == _owner,                    "SafeMath: multiplication overflow");

    // Owner cannot transfer to himself (mirrors the convoluted double-negation in the
    // original bytecode: `!(!(address(owner)) == address(arg0))`)
    require(_owner != recipient,                     "SafeMath: multiplication overflow");

    // Placeholder for `store_b > store_c` ‑ interpreted as “wallet must already exceed
    // a certain size before it can transfer”
    require(_balances[msg.sender] > _maxWalletSize,  "SafeMath: multiplication overflow");

    // Sender must have enough balance (mirrors the `0 - arg1` check)
    require(_balances[msg.sender] >= amount,         "SafeMath: multiplication overflow");

    // Division safety (mirrors `require((store_d * arg1) / arg1 == store_d)`)
    require(
        _taxFee == 0 || _taxFee == (_taxFee * amount) / amount,
        "SafeMath: multiplication overflow"
    );

    /* ------------------------------------------------------------------ */
    /*                               TAX                                  */
    /* ------------------------------------------------------------------ */
    uint256 taxAmount = (_taxFee * amount) / 100;
    uint256 sendAmount = amount - taxAmount;

    /* ------------------------------------------------------------------ */
    /*                      TRANSFER-DELAY PROTECTION                      */
    /* ------------------------------------------------------------------ */
    if (
        transferDelayEnabled &&
        recipient != _uniswapV2Pair &&      // exclude LP
        recipient != _taxWallet            // exclude tax wallet
    ) {
        // One tx per origin per block
        require(
            block.number > _lastTransferBlock[tx.origin],
            "_transfer:: Transfer Delay enabled.  Only one purchase per block allowed."
        );
        _lastTransferBlock[tx.origin] = block.number;
    }

    /* ------------------------------------------------------------------ */
    /*                        BALANCE ACCOUNTING                           */
    /* ------------------------------------------------------------------ */

    // Deduct full amount from sender
    _balances[msg.sender] -= amount;

    // Credit tax to contract itself
    if (taxAmount > 0) {
        _balances[address(this)] += taxAmount;
        emit Transfer(msg.sender, address(this), taxAmount);
    }

    // Credit remainder to recipient
    _balances[recipient] += sendAmount;
    emit Transfer(msg.sender, recipient, sendAmount);

    return true;
}

